import React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';
import IsoIcon from '@mui/icons-material/Iso';
import PeopleAltIcon from '@mui/icons-material/PeopleAlt';
import axios from "axios";

//Dialog
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import useMediaQuery from '@mui/material/useMediaQuery';
import { useTheme } from '@mui/material/styles';
import DialogTitle from '@mui/material/DialogTitle';

import UserActive from './UserActive';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: '#808080',
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
        border: 0,
    },
}));

export default function Users() {

    const [open, setOpen] = React.useState(false);
    const theme = useTheme();
    const fullScreen = useMediaQuery(theme.breakpoints.down('md'));

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };


    const [userList, setUserList] = React.useState([]);
    const [userListtoAD, setUserListtoAD] = React.useState({
        left: [],
        right: [],
    });

    React.useEffect(() => {
        UserList();
    }, []);


    function UserList() {
        const data = {
            LoginToken: localStorage.getItem('auth'),
        }
        const url = 'https://localhost:44374/api/User/userList';
        axios.post(url, data).then((result) => {
            console.log(result);
            setUserList(result.data.Table2);
            setUserListtoAD(result.data);
        })
    }



    const splitData = () => {
        const categorizedItems = {
            left: [],
            right: []
        };

        userList.forEach(item => {
            switch (item.Status) {
                case 'true':
                    categorizedItems.left.push(item);
                    break;
                case 'false':
                    categorizedItems.right.push(item);
                    break;

                default:
                    break;
            }
        });

        return categorizedItems;
    };

    const data = splitData();

    console.log('data', data);

    return (
        <div>
            <span >
                <span style={{ display: 'flex' }}><div><PeopleAltIcon color="secondary" sx={{ mt: 0.8, mr: 1 }} /></div><div style={{ fontSize: "23px" }}>Users List</div></span>
                <Button variant="contained" color="secondary"
                    sx={{
                        width: '40vh', borderRadius: '30px', ml: '155vh', my: 2
                    }}
                    onClick={handleClickOpen}
                >
                    <div style={{ marginRight: '2vh' }}>Enable / Disable User</div> <IsoIcon />
                </Button>
            </span>
            <TableContainer component={Paper}>
                <Table sx={{ minWidth: 700 }} aria-label="customized table">
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>Name</StyledTableCell>
                            <StyledTableCell align="left">Email</StyledTableCell>
                            <StyledTableCell align="left">Active&nbsp;From</StyledTableCell>
                            <StyledTableCell align="left">Last&nbsp;Login</StyledTableCell>
                            <StyledTableCell align="left">Status</StyledTableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {userList.map((row) => (
                            <StyledTableRow key={row.Name}>
                                <StyledTableCell component="th" scope="row">
                                    {row.Name}
                                </StyledTableCell>
                                <StyledTableCell align="left">{row.Email}</StyledTableCell>
                                <StyledTableCell align="left">{row.ActiveFrom == null ? 'NILL' : row.ActiveFrom}</StyledTableCell>
                                <StyledTableCell align="left">{row.LastLogin == null ? 'NILL' : row.LastLogin}</StyledTableCell>
                                <StyledTableCell align="left" style={{ color: row.Status == 1 ? 'Green' : 'red' }}>{row.Status == 1 ? "Enabled" : "Disabled"}</StyledTableCell>
                            </StyledTableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>

            <Dialog
                fullScreen={fullScreen}
                open={open}
                aria-labelledby="responsive-dialog-title"
            >
                <DialogTitle id="responsive-dialog-title">
                    {"Enable / Disable user"}
                </DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        <UserActive message={data} />
                    </DialogContentText>
                </DialogContent>
                <DialogActions >
                    <Button onClick={handleClose} autoFocus variant="contained" color="primary" sx={{ mr: 2, mb: 2 }}>
                        Close
                    </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
}
